import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className="app">
      <header className="header">Header</header>
      <div className="content">
        <aside className="sidebar">Sidebar</aside>
        <main className="main-content">Main Content</main>
      </div>
    </div>
  );
};

export default App;
